import { Button, Row } from 'react-bootstrap';
  /* The following line can be included in your src/index.js or App.js file */
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div>
      <Container>
        <Row>
          <col sm={8}>sm=8</col>
          <col sm={4}>sm=4</col>
        </Row>
        <Row>
          <col sm>sm=true</col>
          <col sm>sm=true</col>
          <col sm>sm=true</col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
